package com.kuaixiu.groupSMS.entity;import com.common.base.entity.BaseEntity;import com.common.util.DateUtil;/** * . * * @CreateDate: 2019-06-19 下午04:31:51 * @version: V 1.0 */public class HsGroupMobileAddress extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private String id ;    /**     * 名字     */    private String nameLabel ;    /**     * 地址     */    private String address ;    /**     * 是否删除     */    private Integer isDel ;    /**     *      */    private java.util.Date createTime ;    /**     *      */    private java.util.Date updateTime ;    private String strCreateTime;    public String getStrCreateTime() {        return DateUtil.getDateyyyyMMddHHmmss(createTime);    }    public void setStrCreateTime(String strCreateTime) {        this.strCreateTime = strCreateTime;    }    public String getId(){        return this.id;    }    public void setId(String id){        this.id=id;    }    public String getNameLabel(){        return this.nameLabel;    }    public void setNameLabel(String nameLabel){        this.nameLabel=nameLabel;    }    public String getAddress(){        return this.address;    }    public void setAddress(String address){        this.address=address;    }    public Integer getIsDel(){        return this.isDel;    }    public void setIsDel(Integer isDel){        this.isDel=isDel;    }    public java.util.Date getCreateTime(){        return this.createTime;    }    public void setCreateTime(java.util.Date createTime){        this.createTime=createTime;    }    public java.util.Date getUpdateTime(){        return this.updateTime;    }    public void setUpdateTime(java.util.Date updateTime){        this.updateTime=updateTime;    }}